import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

function App(){
    return(
        <>
    <h1 className="heading"> Top 5 Netflix List </h1>
      <Card 
        imgsrc = {Sdata[0].imgsrc}
        catagory = {Sdata[0].catagory}
        title = {Sdata[0].title}
        link = {Sdata[0].link}
      />  
      <Card 
        imgsrc = {Sdata[1].imgsrc}
        catagory = {Sdata[1].catagory}
        title = {Sdata[1].title}
        link = {Sdata[1].link}
      />  
      <Card 
        imgsrc = {Sdata[2].imgsrc}
        catagory = {Sdata[2].catagory}
        title = {Sdata[2].title}
        link = {Sdata[2].link}
      />  
      <Card 
        imgsrc = {Sdata[3].imgsrc}
        catagory = {Sdata[3].catagory}
        title = {Sdata[3].title}
        link = {Sdata[3].link}
      />  
      <Card 
        imgsrc = {Sdata[4].imgsrc}
        catagory = {Sdata[4].catagory}
        title = {Sdata[4].title}
        link = {Sdata[4].link}
      />  
    </>
    );
};
export default App;
